Information
------------------------------

End of the Big Cats
Can you imagine a life without Lions, Cheetahs and Leopards?
Fifty years ago, there were more than half a million lions in Africa. Today there are fewer than 20,000. A world without these majestic predators could soon become a reality.
This series gives a new perspective on the problems suffered by the big cats in this changing era in Africa. With the illegal and legal hunting ever prevalent, will society listen to how they can keep these cats alive?
'The end of the big cats' is a documentary film based on denouncing the dramatic decline of the big cats in Africa, and showing the conservancy initiatives for keeping these species alive in wildlife for the next generations. The documentary gives the floor to conservationists and farmers who explain which is their relation with the big cats and also describes the situation of these fabulous animals in Africa. Besides the explanations, the documentary shows big cats and other animals in wildlife, several hunting scenes and conservationists' iniciatives.

